En prestation le groupe Red Hot Chili Peppers !!

Ce groupe rock américain à été formé en 1983 à Los Angeles.  Leur musique mêle principalement des éléments de <a href="http://fr.wikipedia.org/wiki/Rock">rock</a> et de <a href="http://fr.wikipedia.org/wiki/Funk">funk</a>, avec des influences <a href="http://fr.wikipedia.org/wiki/Punk_rock">punk</a>, <a href="http://fr.wikipedia.org/wiki/Heavy_metal_(musique)">metal</a> et de <a href="http://fr.wikipedia.org/wiki/Rap">rap</a>.  Soyez les premiers à les voir en spectacle à Québec !!

