En prestation un soir seulement, le groupe Green Day.  Ce groupe d'opéra rock originaire de Oakland en Californie a été formé en 1987.  À ce jour, Green Day aurait vendu plus de 65 millions d'albums à travers le monde dont plus de 22,5 millions d'albums aux États-Unis<a href="http://fr.wikipedia.org/wiki/Green_Day#cite_note-7">7</a>. Ils ont récolté de nombreux prix, dont quatre Grammy Awards.

&nbsp;

url: <a href="http://www.greenday.com/">http://www.greenday.com/</a>

facebook: <a href="https://www.facebook.com/GreenDay">https://www.facebook.com/GreenDay</a>

