Venez voir Journez en prestation spéciale !!  Ce groupe de soft rock américain fondé en 1973 à San<a href="http://fr.wikipedia.org/wiki/San_Francisco"> F</a>rancisco autour de Neal Schon et Greeg Rolie(en), anciens musiciens de Santana. Le groupe est passé par plusieurs phases; le plus fort de son succès commercial a eu lieu entre 1978 et 1987, après quoi le groupe s'est temporairement séparé. Après une longue mise en suspens à la suite deRaised on Radio, le groupe s'est reformé dans les années 1990 avec une succession de chanteurs.

&nbsp;

url: <a href="http://www.journeymusic.com/home">http://www.journeymusic.com/home</a>

facebook: <a href="https://www.facebook.com/journey">https://www.facebook.com/journey</a>

