Lady Gaga à Québec !!  Stefani Germanotta, dite Lady Gaga, née le 28 mars 1986, à New-York, aux États-Unis, est une auteur-compositrice-interprète américaine.  Elle  attire l’attention médiatique en tant que chanteuse à la suite de la sortie de son premier album, The Fame, qui est applaudi par la critique en plus d’être un succès commercial, trônant sur les palmarès à travers le monde et incluant les numéros-un Just Dance et Poker Face.

